import React, { Component } from "react";
import "./banner.css";

//Stateless Functional Component

const NavBar = () => {
  return (
    <div class="jumbotron jumbotron-fluid">
      <div class="container">
        <h1 class="display-10">Omellete du fromage</h1>
        <p class="lead">A facilitar visitas desde 2020</p>
      </div>
    </div>
  );
};

export default NavBar;
